import { Input, InputLabel } from "@mui/material";
import FormControl from "@mui/material/FormControl";

function App() {
  return (
    <FormControl>

      <Input id="title-input" placeholder="Title" />
      <InputLabel htmlFor="details-input">Todo Details</InputLabel>
      <Input id="details-input" />
      <InputLabel htmlFor="date-input">Todo Date</InputLabel>
      <Input id="date-input" />
    </FormControl>
  );
}

export default App;
